import React from "react";

const Auth = () => {
  return (
    <>
      <div className="container h-100">
        <div className="row h-100 align-items-center justify-content-center">
          <div className="hero">
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
          </div>
          <div className="col-sm-10 col-md-8 col-lg-5">
            <div className="middle-box py-4">
              <div className="card">
                <div className="card-body p-4">
                  {/* Logo */}
                  <h4 className="font-24 mb-30">Login.</h4>
                  
                  {/* end card */}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Auth;
